        DlcName: "mpbeach",
        Category: "GROUP_MELEE",
        TranslatedDescription: {
            Hash: 3517691093,
            English:
                "It's not clever and it's not pretty but, most of the time, neither is the guy coming at you with a knife. When all else fails, this gets the job done. Part of the Beach Bum Pack.",
            German: "Weder klug noch schön, aber das ist der Typ, der mit einem Messer auf dich losgeht, ja auch nicht. Die Lösung, wenn alle Stricke reißen. Teil des Strandliebhaber-Packs.",
            French: "Ce n'est certes pas l'arme la plus élégante ni la plus efficace, mais quand le type en face a un couteau, c'est forcément mieux que rien. (Pack Plagiste)",
            Italian: "Non è aggraziata, ma non lo è nemmeno il tizio che ti assalirà con un coltello. In mancanza di meglio, servirà al suo scopo. Parte del pacchetto contenuti Beach Bum.",
            Russian: 'Некрасивое и нехитрое оружие. Старая добрая бутылка выручит вас в любой ситуации. Входит в набор "Пляжный бездельник".',
            Polish: "Mało wyrafinowana i nieszczególnie piękna, ale najczęściej tak samo prezentuje się gość, który chce cię zanożować. Gdy wszystko inne zawiedzie, to i to jest metoda.",
            Name: "WTD_BOTTLE",
            TraditionalChinese: "不中看也不中用的玩意，就像那些壞人。其他辦法都失敗時，這玩意能幫您解決問題。係屬海灘遊樂包。",
            SimplifiedChinese: "用它打架既不明智，也不美观。但大部分情况下，朝您扑面而来的家伙可是提着把刀的。别无他法时，这玩意再好不过了。属于《海滩游乐》包。",
            Spanish: "No es una maniobra limpia ni inteligente pero, la mayoría de las veces, el que va a por ti con un cuchillo tampoco lo es. Parte del pack Playero.",
        },
