            SimplifiedChinese: "您可以将这把枪像避孕套或发胶一样装在口袋里，然后去好麦坞的俱乐部里享受夜生活。它的精度只有香槟酒瓶塞的一半，但杀伤力是它的两倍。属于《海滩游乐》包。",
            Spanish: "Igual que los condones o la laca, cabrá en tu bolsillo para una noche de juerga. Es menos precisa que el corcho de una botella, pero el doble de mortal. Parte del pack Playero.",
