            French: 'Chacun se doit d\'avoir une arme facilement reconnaissable. Démarquez-vous avec un pistolet vintage gravé. Disponible dans la mise à jour "Hipster toi-mêmeµ!".',
            Italian: "Quello che vuoi è un'arma riconoscibile. Spicca tra la folla durante una rapina con questa pistola vintage con incisioni. Parte dell'aggiornamento \"Non sono un Hipster\".",
            Russian: "Вам необходимо узнаваемое и уникальное оружие? С этим винтажным пистолетом вы виделитесь из толпы. Входит в набор ''Я не хипстер''.",
            Polish: 'Czego potrzebujesz, to wyróżniająca się broń. Zabłyśnij w trakcie napadu z tym grawerowanym pistoletem vintage. Część aktualizacji "Nie jestem hipsterem".',
            Name: "WTD_VPISTOL",
            TraditionalChinese: '您需要一把更顯個性的槍。搶劫中使用雕花的復古手槍，可突顯自己。係屬"自以為潮"內容更新。',
            SimplifiedChinese: "您真正需要的是一把更显眼的枪。持械抢劫时，掏出这把雕工精湛的手枪，在人群中大出风头吧。属于《自以为潮》内容更新。",
            Spanish: 'Lo que necesitas de verdad es un arma más reconocible. Destaca entre los demás en un robo a mano armada con esta pistola grabada. Parte de la actualización "No soy un Hipster".',
