            French: "Qu'est-ce qui est petit, prêt à balancer la sauce et rentre dans votre frocµ? Perdu, c'était l'autre. Disponible dans Motos, boulots, bobos.",
            Italian: "Quante armi antisommossa puoi dire di avere nei pantaloni? OK, due. Ma questa è quella che puoi mostrare in giro. Parte di Centauri.",
            Russian: 'Сколько эффективных инструментов управления толпой можно засунуть в штаны? Ну ладно, два. И это - второй. Часть обновления "Байкеры".',
