            Italian: "Non ne hai mai abbastanza delle cose che funzionano. Se il primo colpo è quello che conta, i cento successivi dovrebbero valere doppio!",
            Russian: "Кашу маслом не испортишь. В конце концов, если первый выстрел важен, то последующие сто с лишним важны вдвойне.",
            Polish: "Dobrego nigdy za wiele: w końcu jeśli pierwszy strzał trafi, to kolejnych sto już liczy się podwójnie.",
            Name: "WTD_MG_CBT2",
            TraditionalChinese: "俗話說，好東西永遠不嫌多：畢竟，如果射中第一發就很爽的話，那麼接下來的幾百發就更加爽翻倍。",
            SimplifiedChinese: "俗话说，好东西永远不嫌多：毕竟，如果射中的第一发就很爽，那接下来的几百发必将快感倍增。",
            Spanish: "Uno nunca se cansa de lo bueno: al fin al cabo, si el primer disparo cuenta, los cien siguientes tienen que contar el doble.",
