            TraditionalChinese: "穩定和諧、簡單俐落、準確無誤：要說到掌控局面、維護秩序，最好的方式還是用加長型槍管捅入別人的嘴巴。",
            SimplifiedChinese: "平衡、简单、精准：要让一个人保持缄默，最好的方式就是用加长枪管给这家伙嘴里来一枪。",
